from deepface import DeepFace
from fer import FER
import cv2
import numpy as np
import base64


def BasetoImage(base64_data):
    # 1. 헤더 제거 (예: "data:image/jpeg;base64," 부분 제거)
    base64_data = base64_data.split(",")[1]

    # 2. Base64 디코딩
    image_data = base64.b64decode(base64_data)

    # 3. 디코딩된 데이터를 numpy 배열로 변환
    image_array = np.frombuffer(image_data, np.uint8)

    # 4. OpenCV에서 읽을 수 있는 형식으로 변환
    image = cv2.imdecode(image_array, cv2.IMREAD_COLOR)
    return image


def GetEmotionProbsDeepFace(img):
    # DeepFace를 사용해 감정 확률 추출
    objs = DeepFace.analyze(
        img_path=img,
        actions=['emotion'],
        detector_backend='retinaface',
    )
    objs = objs[0]
    return objs['emotion']  # 감정별 확률 분포 반환


def GetEmotionProbsFER(img):
    # FER를 사용해 감정 확률 추출
    emotion_detector = FER(mtcnn=True)
    emotions = emotion_detector.detect_emotions(img)
    if len(emotions) > 0:
        return emotions[0]['emotions']  # FER의 첫 번째 얼굴 감정 확률 반환
    else:
        return {}  # 얼굴이 검출되지 않은 경우 빈 딕셔너리 반환


def MergeEmotionProbs(deepface_probs, fer_probs, deepface_weight=0.6, fer_weight=0.4):
    # 두 모델의 감정 확률을 가중 평균으로 결합
    combined_probs = {}
    all_emotions = set(deepface_probs.keys()).union(fer_probs.keys())
    for emotion in all_emotions:
        deepface_prob = deepface_probs.get(emotion, 0)
        fer_prob = fer_probs.get(emotion, 0)
        combined_probs[emotion] = (
            deepface_prob * deepface_weight +
            fer_prob * fer_weight
        )

    # 최종 결합된 확률에서 가장 높은 감정 반환
    dominant_emotion = max(combined_probs, key=combined_probs.get)
    return dominant_emotion, combined_probs


img_path = "data:image/jpeg;base64,"

async def detect_emotion(img_path):
    # Base64 데이터 이미지 변환
    img = BasetoImage(base64_data=img_path)

    # DeepFace와 FER로 감정 확률 분석
    deepface_probs = GetEmotionProbsDeepFace(img)
    fer_probs = GetEmotionProbsFER(img)

    # 두 모델의 결과를 결합
    dominant_emotion, combined_probs = MergeEmotionProbs(deepface_probs, fer_probs)
    
    return dominant_emotion

